import React from "react";
import "./Section.css";

const Section = ({ title, data, type }) => {
    return (
        <div className="section">
            <h2>{title}</h2>
            <table>
                <thead>
                {type === "applications" && (
                    <tr>
                        <th>Durum</th>
                        <th>Tarih</th>
                        <th>Saat</th>
                        <th></th>
                    </tr>
                )}
                {type === "feedbacks" && (
                    <tr>
                        <th>Durum</th>
                        <th>Aktivite</th>
                        <th>Tarih</th>
                        <th>Saat</th>
                        <th>Oy</th>
                        <th>Geri Bildirim</th>
                    </tr>
                )}
                </thead>
                <tbody>
                {data.map((item, index) => (
                    <tr key={index}>
                        {type === "applications" && (
                            <>
                                <td>{item.status}</td>
                                <td>{item.date}</td>
                                <td>{item.time}</td>
                                <td>
                                    {item.action ? (
                                        <a href="#" className="edit-button">
                                            {item.action}
                                        </a>
                                    ) : null}
                                </td>
                            </>
                        )}
                        {type === "feedbacks" && (
                            <>
                                <td>{item.status}</td>
                                <td>{item.activity}</td>
                                <td>{item.date}</td>
                                <td>{item.time}</td>
                                <td className="stars">
                                    {[...Array(5)].map((_, i) => (
                                        <i
                                            key={i}
                                            className={`fas fa-star ${i < item.stars ? "" : "inactive"}`}
                                        ></i>
                                    ))}
                                </td>
                                <td>
                                    <i className="fas fa-pen edit-icon"></i>
                                </td>
                            </>
                        )}
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default Section;
